Og="Rólam",Ig="Nagyon motivált frontend és full-stack fejlesztő vagyok, aki erős alapokkal rendelkezik a modern webes technológiákban. A technológiai világba való utam a gimnáziumi éveim alatt kezdődött, amikor felfedeztem az informatikát, és később a webfejlesztést. Azóta elköteleztem magam az intuitív és hatékony webalkalmazások fejlesztése mellett. Az évek során a tudásomat egyaránt építettem akadémiai tanulmányokkal, online kurzusokkal és gyakorlati projektekkel. Egyik legnagyobb mérföldkövem tavasszal történt, amikor lehetőségem volt részt venni egy intenzív gyakornoki programban. Ez idő alatt egy full-stack projektben dolgoztam, amely a TALL Stack (Tailwind CSS, Alpine.js, Livewire és Laravel) technológiát használta, így mélyebb tudást szereztem mind a frontend, mind a backend fejlesztésben.",Rg="Fókuszom a reszponzív és felhasználóbarát alkalmazások létrehozására irányul, amelyek nemcsak a kliens igényeit elégítik ki, hanem kiváló felhasználói élményt is nyújtanak. A webfejlesztés számomra nemcsak egy hivatás, hanem egy mesterség is. Folyamatosan új eszközöket, keretrendszereket és legjobb gyakorlatokat kutatok, hogy mindig naprakész legyek a folyamatosan változó technológiai világban. Célom, hogy hozzájáruljak olyan innovatív projektekhez, amelyek jelentős hatással bírnak, akár bonyolult folyamatok egyszerűsítésével, akár olyan megoldások szállításával, amelyek értéket adnak a felhasználóknak.",Pg="Amikor nem kódolok, különféle hobbikat űzök, amelyek segítenek megőrizni az egyensúlyomat és inspirálnak. Szeretek edzeni, hogy megőrizzem a fizikai és mentális jólétemet, filmeket és sorozatokat nézni, valamint időt tölteni a barátaimmal, hogy feltöltődjek. Ezek a tevékenységek emlékeztetnek arra, hogy mennyire fontos a kiegyensúlyozott élet, amely szerintem kulcs a tartós fejlődéshez és sikerhez, személyesen és szakmailag egyaránt.",Ag="Elérhetőségek",Ng="Önéletrajz",Mg="/Profile/Balázs_Norbert_hu.pdf",$g={developerIntro:dg,learn:mg,projects:pg,linkedin:hg,myResume:gg,viewResume:_g,downloadResume:bg,viewCertificate:vg,project:yg,portfolio:xg,developed:wg,webApp:Eg,figma:kg,development:Sg,databases:Tg,other:Lg,skills:Cg,aboutMe:Og,aboutMeText1:Ig,aboutMeText2:Rg,aboutMeText3:Pg,contacts:Ag,resume:Ng,resumeLink:Mg},Dg="Sunt un dezvoltator web axat pe frontend, cu o înțelegere solidă a tehnologiilor backend și pasiune pentru construirea de aplicații web frumoase și responsive.",Fg="Află mai multe",jg="Proiecte",Ug="Profil Linkedin",Hg="CV-ul meu:",Vg="Vezi CV-ul",Wg="Descarcă CV-ul",zg="Vezi Certificatul",Bg="proiect",Kg="Portofoliu",Gg="Am dezvoltat o",Yg="aplicație web",qg="bazată pe designuri din Figma",Xg="Dezvoltare",Jg="Baze de date",Qg="Altele",Zg="Abilități",e0="Despre mine",t0="Sunt un dezvoltator frontend și full-stack foarte motivat, cu o bază solidă în tehnologiile web moderne. Călătoria mea în lumea tehnologiei a început în anii de liceu, când am descoperit informatica și mai târziu dezvoltarea web. De atunci m-am dedicat construirii de aplicații web intuitive și eficiente. De-a lungul anilor, mi-am dezvoltat abilitățile printr-o combinație de învățare academică, cursuri online și proiecte practice. Unul dintre momentele de vârf din experiența mea a fost primăvara trecută, când am avut ocazia să particip la un program intensiv de stagiu. În această perioadă, am lucrat la un proiect full-stack utilizând TALL Stack (Tailwind CSS, Alpine.js, Livewire și Laravel), ceea ce mi-a permis să îmi aprofundez înțelegerea atât a dezvoltării frontend, cât și backend.",n0="Mă concentrez pe crearea de aplicații responsive și prietenoase cu utilizatorul, care nu doar că îndeplinesc cerințele clienților, dar și oferă o experiență excelentă utilizatorului. Dezvoltarea web pentru mine nu este doar o profesie, ci și o artizanat. Sunt într-o continuă explorare a noilor instrumente, cadre de lucru și bune practici pentru a rămâne în față în peisajul tehnologic în continuă schimbare. Scopul meu este să contribui la proiecte inovative care au un impact semnificativ, fie prin simplificarea proceselor complexe, fie prin livrarea de soluții care aduc valoare utilizatorilor.",r0="Când nu programez, îmi place să urmăresc o varietate de hobby-uri care mă ajută să rămân echilibrat și inspirat. Îmi place să fac exerciții fizice pentru a menține atât bunăstarea fizică, cât și mentală, să vizionez filme și serii și să petrec timp cu prietenii pentru a mă reîncărca. Aceste activități îmi amintesc de importanța unei vieți echilibrate, care cred că este cheia pentru o creștere și succes susținute, atât pe plan personal, cât și profesional.",s0="Contacte",o0="CV",i0="/Profile/Balázs_Norbert_en.pdf",l0={developerIntro:Dg,learn:Fg,projects:jg,linkedin:Ug,myResume:Hg,viewResume:Vg,downloadResume:Wg,viewCertificate:zg,project:Bg,portfolio:Kg,developed:Gg,webApp:Yg,figma:qg,development:Xg,databases:Jg,other:Qg,skills:Zg,aboutMe:e0,aboutMeText1:t0,aboutMeText2:n0,aboutMeText3:r0,contacts:s0,resume:o0,resumeLink:i0},a0=vd({locale:"en",fallbackLocale:"en",messages:{en:fg,hu:$g,ro:l0}});vu(rm).use(Uh).use(a0).mount("#app");
